import React from "react";

const x = [
  { name: "maninder", age: "20", work: "programmer" },
  { name: "ramanpreet", age: "19", work: "teacher" },
];

function just(data) {
  return x.map((val) => {
    <>
      <h1>My Name is {val.name}</h1>
      <h2>My Age is {val.age}</h2>
      <h3>My Work is {val.work}</h3>
    </>;
  });
}

export default just;
export {x};
